import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => (
  <nav class="navbar bg-body-tertiary">
  <form class="container-fluid justify-content-start">
    <Link className="nav-link" to="/">
    <button class="btn btn-outline-success me-2" type="button">Inicio</button></Link>
    <Link className="nav-link" to="/graficos">
    <button class="btn btn-sm btn-outline-secondary" type="button">Gráficos</button></Link>
    <Link className="nav-link" to="/estimador">Estimación Renovable
    <button class="btn btn-sm btn-outline-secondary" type="button">Gráficos</button></Link>
  </form>
  </nav>
);

export default Navbar;
